import React from 'react';
import Button from '@material-ui/core/Button';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';
import Grid from '@material-ui/core/Grid';
import SaveIcon from '@material-ui/icons/Save';

const columns = [
  { id: 'name', label: 'N째', minWidth: 70 },
  { id: 'code', label: 'N째 de control', minWidth: 100 },
  {
    id: 'population',
    label: 'Nombre Completo del Alumno',
    minWidth: 170,
    align: 'right',
    format: value => value.toLocaleString(),
  },
  {
    id: 'size',
    label: 'Curso',
    minWidth: 170,
    align: 'right',
    format: value => value.toLocaleString(),
  },
  {
    id: 'density',
    label: 'Opcion',
    minWidth: 90,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: '#',
    minWidth: 70,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: '#',
    minWidth: 70,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: '#',
    minWidth: 70,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: '___',
    minWidth: 40,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: 'C1=X1%',
    minWidth: 40,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: 'C1=X2%',
    minWidth: 40,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: 'C1=X3%',
    minWidth: 40,
    align: 'right',
    format: value => value.toFixed(2),
  },
  {
    id: 'density',
    label: 'TOTAL',
    minWidth: 40,
    align: 'right',
    format: value => value.toFixed(2),
  },
];

state ={

}

function createData(name, code, population, size) {
  const density = population / size;
  return { name, code, population, size, density };
}

const rows = [
  createData('India', 'IN', <text value=""/>, 3287263),
  createData('China', 'CN', 1403500365, 9596961),
  createData('Italy', 'IT', 60483973, 301340),
  createData('United States', 'US', 327167434, 9833520),
  createData('Canada', 'CA', 37602103, 9984670),
  createData('Australia', 'AU', 25475400, 7692024),
  createData('Germany', 'DE', 83019200, 357578),
  createData('Ireland', 'IE', 4857000, 70273),
  createData('Mexico', 'MX', 126577691, 1972550),
  createData('Japan', 'JP', 126317000, 377973),
  createData('France', 'FR', 67022000, 640679),
  createData('United Kingdom', 'GB', 67545757, 242495),
  createData('Russia', 'RU', 146793744, 17098246),
  createData('Nigeria', 'NG', 200962417, 923768),
  createData('Brazil', 'BR', 210147125, 8515767),
];

const useStyles = makeStyles({
  root: {
    width: '100%',
  },
  container: {
    maxHeight: 440,
  },
});

export default function StickyHeadTable() {
  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
      <div>
          <Grid container spacing={3}>
          <Grid item xs={12}>
          <Paper > INSTITUTO TECNOLOGICO SUPERIOR DE LOS RIOS</Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper >Cnponente1</Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper >libre</Paper>
        </Grid>
        <Grid item xs={12} sm={12}>
          <Paper > <Paper className={classes.root}>
      <TableContainer className={classes.container}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map(column => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map(row => {
              return (
                <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                  {columns.map(column => {
                    const value = row[column.id];
                    return (
                      <TableCell key={column.id} align={column.align}>
                        {column.format && typeof value === 'number' ? column.format(value) : value}
                      </TableCell>
                    );
                  })}
                </TableRow>
              );
            })}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[5, 25, 100]}
        component="div"
        count={rows.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onChangePage={handleChangePage}
        onChangeRowsPerPage={handleChangeRowsPerPage}
      />
    </Paper>
</Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper >*O: Ordinario   *1:Primera oportunidad   *NA: No Alcanza</Paper>
          <Paper >*R: Repeticion   *2:Segunda oportunidad</Paper>
          <Paper >*E: Especial</Paper>
        </Grid>
        <Grid item xs={12}>
        <Button
        variant="contained"
        color="primary"
        size="small"
       
        startIcon={<SaveIcon />}
      >
        Descargar Reporte de Calificaciones
      </Button>
        </Grid>
          </Grid>

       </div>
  );
}
